using System;
namespace LeetCodeProblems
{
	public class Problem1047: Solution
	{
		public Problem1047()
		{
		}

        public void Run()
        {
            string actual = RemoveDuplicates("abbaca");
            string expected = "ca";
            Console.WriteLine("Outcome: {0} {1}", expected, actual);

            actual = RemoveDuplicates("azxxzy");
            expected = "ay";
            Console.WriteLine("Outcome: {0} {1}", expected, actual);

            actual = RemoveDuplicates("abc");
            expected = "abc";
            Console.WriteLine("Outcome: {0} {1}", expected, actual);

            actual = RemoveDuplicates("aabc");
            expected = "bc";
            Console.WriteLine("Outcome: {0} {1}", expected, actual);

            actual = RemoveDuplicates("aaabc");
            expected = "abc";
            Console.WriteLine("Outcome: {0} {1}", expected, actual);

            actual = RemoveDuplicates("abcc");
            expected = "ab";
            Console.WriteLine("Outcome: {0} {1}", expected, actual);

            actual = RemoveDuplicates("azxxzyabcc");
            expected = "ayab";
            Console.WriteLine("Outcome: {0} {1}", expected, actual);

            actual = RemoveDuplicates("abba");
            expected = "";
            Console.WriteLine("Outcome: {0} {1}", expected, actual);

            actual = RemoveDuplicates("aaaaaaaa");
            expected = "";
            Console.WriteLine("Outcome: {0} {1}", expected, actual);

            actual = RemoveDuplicates("heejcjciegbdejajigjiijiiedjddibgjbebichbeadidiidhcjacagbjhajadbiigeceeahfijjiafcj");
            expected = "hjcjciegbdejajigedjibgjbebichbeadihcjacagbjhajadbgecahfafcj";
            Console.WriteLine("Outcome: {0}", expected == actual);

            actual = RemoveDuplicates("");
            expected = "";
            Console.WriteLine("Outcome: {0} {1}", expected, actual);
        }

        public string RemoveDuplicates(string s)
        {
            string ret = s;

            for (int i = 0; i < ret.Length - 1; i++)
            {
                int start = i;
                int end = i + 1;
                bool found = false;
                while (start >= 0 && end < ret.Length && ret[start] == ret[end])
                {
                    found = true;
                    start--;
                    end++;
                }

                if (found)
                {
                    string temp = ret.Substring(0, start + 1);
                    temp += ret.Substring(end);
                    ret = temp;
                    i =-1;
                }
            }

            return ret;
        }
    }
}

